from time import sleep, perf_counterfrom threading import Threaddef numUniqueEmails(emails: list) -> int:    sleep(1)    result = set()    for email in emails:        local, a = email.split('@')        local = local.split('+')[0]        local = local.replace('.', "")        result.add((local, a))    return len(result)ls = ["test.email+alex@leetcode.com", "test.e.mail+bob.cathy@leetcode.com", "testemail+david@lee.tcode.com",      'ira.h.ma.tjo.n06+2006@gma.il.com', 'ra.hm.a.tjon.ibra.gi.mov.17+ss@gmail.com', 'tu.r.ab.o.v+o.yb.bb@gmail.com',      'cha.ff.ar+dsf@hotmail.com', 'ag.olom.s+h@gm.ai.l.com', 'flu.ff.+y@live.com', 'da.la.m+fb@hotmail.com', 'jel.m+er@ic.loud.com',      'lis.h.o.y+@op.ton.l.ine.net', 'g.re+ear@yahoo.com', 'kon.st@hotmail.com', 'pet.er.ho+eg@opto.nline.net', 'op.enl.dap@icloud.com',      'tb.ec.k+dsa@opto.nline.net']start = perf_counter()res = numUniqueEmails(ls)print(res)end = perf_counter()print(f'{end - start:.5f}')  # 1.0036 <- not threadstart_t = perf_counter()t1 = Thread(target=numUniqueEmails, args=(ls, ))t2 = Thread(target=numUniqueEmails, args=(ls, ))t3 = Thread(target=numUniqueEmails, args=(ls, ))t1.start()t2.start()t3.start()t1.join()t2.join()t3.join()end_t = perf_counter()print(f'Thread -> {end_t - start_t:.5f}')  # 1.0024 <- thread